import React from "react";

const ExpencseDes = () => {
  return (
    <div className="flex">
      <div className="ml-16">
        <img
          src="images/Rectangle1.png"
          alt="rectangle"
          width={632}
          height={470}
        />
      </div>
      <div className="flex flex-col justify-center w-[620px] h-[470px] shadow-lg items-center text-center bg-white mr-20">
        <span>
          <img src="images/star.png" alt="star" />
        </span>
        <p className="mt-6">
          "It is a long established fact that a reader will be <br /> distracted
          by the readable content of a page <br />
          when looking at its layout."
        </p>
        <h1 className="text-[050F4E] font-bold mt-6">Coriss Ambady</h1>
        <p className="mt-1">Neurologist</p>
        <span className="mt-4">
          {/* <img src="images/dot.png" alt="dot" /> */}
        </span>
      </div>
    </div>
  );
};

export default ExpencseDes;
